import React, {Component, useState} from "react";
import './Navbar.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import { BrowserRouter} from 'react-router-dom';
import {
    Collapse,
    Navbar,
    NavbarToggler,
    NavbarBrand,
    Nav,
    NavItem,
    NavLink
   } from 'reactstrap';

export class Navigation extends Component {
    constructor(props) {
      super(props);
      this.state = {
        collapsed: false,
        setCollapsed: false,
        toggleNavbar: null,
      }
    }

    

    render() {
      this.state.collapsed = useState(true);
      this.state.setCollapsed = useState(true);
      this.state.toggleNavbar = () => this.setCollapsed(!this.collapsed);

      return (
        <div className = "Navbar">
        <Navbar color = "dark" dark expand = "md">
          <NavbarBrand style = {{color: '#c7cfd9', textDecoration: 'none'}} href = "/">Empowering Knowledge</NavbarBrand>
            <Nav className ="ml-auto" navbar>
              <NavItem>
                <BrowserRouter>
                    <NavLink  href="/about" className="nav-link">About</NavLink>
                </BrowserRouter>
              </NavItem>
              <NavItem>
                <BrowserRouter>
                    <NavLink href="/politicians" className="nav-link">Politicians</NavLink>
                </BrowserRouter>
              </NavItem>
              <NavItem>
                <BrowserRouter>
                    <NavLink href="/states" className="nav-link">States</NavLink>
                </BrowserRouter>
              </NavItem>
              <NavItem>
                <NavLink href="/bills" className="nav-link">Energy Bills</NavLink>
              </NavItem> 
            </Nav>
        </Navbar>
      
        
      </div>
      );
    }
}

export default Navigation;
